import ALL_PRODUCT_DATA from './ALL_PRODUCT_DATA';

const INITIAL_STATE = {
    collections: ALL_PRODUCT_DATA
};

const collectionPreviewReducer = (state = INITIAL_STATE, action) => {
    switch(action.type) {
        default:
            return state;
    }
}

export default collectionPreviewReducer;
